import React from 'react'
import './direct-content.css'
import PropTypes from 'prop-types'

export default class DirectContent extends React.Component {
  constructor(props) {
    super(props)
    DirectContent.propTypes = {
      attribute: PropTypes.number,
      sectionTitle: PropTypes.string,
      teacherName: PropTypes.string,
      partNum: PropTypes.string,
      liveTime: PropTypes.string,
      playNum: PropTypes.string,
      studyProgress: PropTypes.string,
      studyStatus: PropTypes.string,
      videoTime: PropTypes.string
    }
    DirectContent.defaultProps = {
      attribute: 0,
      sectionTitle: '',
      teacherName: '',
      partNum: '',
      liveTime: '',
      playNum: '',
      studyProgress: '',
      studyStatus: '',
      videoTime: ''
    }
  }
  render() {
    const { directNum = [] } = this.props.directData
    const [attribute,sectionTitle,teacherName,partNum,liveTime,playNum,studyProgress,studyStatus,videoTime] = directNum
    return (
      <div className='DirectContent'>
        {
          directNum.map( (item , index) => {
            return(
              <div key={index}>{attribute}
                <div>{item.attribute}</div>
                <div>{index}</div>
                <div>......</div>
                </div>

            )
          })
        }
        <div>......</div>
        <div>{this.props.directData.attribute}</div>
      </div>
    )
  }
}
